-- ----------------------------
--  Table structure for `quartz_job`
-- ----------------------------
DROP TABLE IF EXISTS `quartz_job`;
CREATE TABLE `quartz_job` (
  `job_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '任务id',
  `bean_name` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT 'spring bean名称',
  `method_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '方法名',
  `params` text COLLATE utf8_bin COMMENT '参数',
  `cron_expression` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT 'cron表达式',
  `status` tinyint(4) DEFAULT NULL COMMENT '任务状态',
