-- ----------------------------
--  Table structure for `sys_menu`
-- ----------------------------
DROP TABLE IF EXISTS `sys_menu`;
CREATE TABLE `sys_menu` (
  `id` int(36) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `parent_id` int(11) DEFAULT NULL COMMENT '父ID',
  `left_num` int(11) DEFAULT NULL COMMENT '左边界值',
  `right_num` int(11) DEFAULT NULL COMMENT '右边界值',
  `name` varchar(100) DEFAULT NULL COMMENT '菜单名称',
  `sort` int(10) DEFAULT NULL COMMENT '排序',
  `href` varchar(256) DEFAULT NULL COMMENT '链接',
  `icon` varchar(256) DEFAULT NULL COMMENT '图标',
  `level` int(11) DEFAULT NULL COMMENT '级别[1:菜单，2:功能]',
  `state` int(1) DEFAULT NULL COMMENT '状态[1:显示，0:不显示]',
  `permission` varchar(200) DEFAULT NULL COMMENT '权限标识',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
