DROP TABLE IF EXISTS `sys_org`;
CREATE TABLE `sys_org` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `parent_id` int(10) DEFAULT NULL COMMENT '父机构id',
  `left_num` int(11) DEFAULT NULL COMMENT '左边界值',
  `right_num` int(11) DEFAULT NULL COMMENT '右边界值',
  `code` varchar(100) DEFAULT NULL COMMENT '机构编码',
  `name` varchar(100) DEFAULT NULL COMMENT '机构名称',
  `name_py` varchar(255) DEFAULT NULL COMMENT '机构名称拼音',
  `type` int(2) DEFAULT NULL COMMENT '机构类型',
  `state` int(1) DEFAULT NULL COMMENT '状态[1:在用，0:停用]',
  `sort` int(16) DEFAULT NULL COMMENT '排序号',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `del_flag` varchar(1) DEFAULT '0' COMMENT '删除标记[0:未删除，1:删除]',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=376 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='机构表';

