-- ----------------------------
--  Table structure for `sys_role`
-- ----------------------------
DROP TABLE IF EXISTS `sys_role`;
CREATE TABLE `sys_role` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `code` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '角色编码',
  `name` varchar(100) DEFAULT NULL COMMENT '角色名称',
  `type` int(1) DEFAULT NULL COMMENT '角色类型[1:管理角色，2:普通角色]',
  `state` int(1) DEFAULT NULL COMMENT '状态[1:在用，0:停用]',
  `data_scope` int(1) DEFAULT NULL COMMENT '数据范围[1：所有数据；2：所在机构及以下数据；3：所在机构数据；4：仅本人数据；5：按明细设置]',
  `level` int(1) DEFAULT NULL COMMENT '等级[1:系统，2:业务]',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` varchar(1) DEFAULT '0' COMMENT '删除标记[0:未删除，1:删除]',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='系统角色';

-- ----------------------------
--  Records of `sys_role`
-- ----------------------------
